import Stack from "@mui/material/Stack";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import { useState } from "react";

const ConfigurationForm = () => {
    const [totalTickets, setTotalTickets] = useState(0);

  return (
    <Stack component="form" noValidate autoComplete="off">
      <h1>Configuration Form</h1>
      <TextField required id="outlined-required" label="Total Tickets" />
      <TextField required id="outlined-required" label="Ticket Release Rate" />
      <TextField required id="outlined-required" label="Customer Retrieval Rate" />
      <TextField required id="outlined-required" label="Max Ticket Capacity" />
      <TextField required id="outlined-required" label="Number of Vendors" />
      <TextField required id="outlined-required" label="Number of Customers" />
      <Button variant="contained" color="success">Submit</Button>
    </Stack>

  );
};

